import React from 'react';

const DUMMY_EVENTS = [
  {
    id: 'e1',
    title: 'Event 1',
  },
  {
    id: 'e2',
    title: 'Event 2',
  },
  {
    id: 'e4',
    title: 'Event 3',
  },
];

const EventsPage = () => {
  return (
    <>
      <h1>Events Page</h1>
      <ul>
        {DUMMY_EVENTS.map((event) => (
          <li key={event.id}><Link to={event.id}></Link></li>
        ))}
    </ul>
    </>
  )
};

export default EventsPage;
